import React from "react";
import "../styles/AdminDashboard.css";
import Logo from "../assets/logo light.jpg";
import UserImage from "../assets/user-image.jpg";

function AdminDashboard({ auth, setAuth }) {
  //   const handleLogout = () => {
  //     localStorage.clear();
  //     setAuth({ isAuthenticated: false, role: null, username: "" });
  //   };

  return (
    <div className="admn-dashboard">
      {/* top line */}
      <div className="top-line">
        <div className="top-left">
          <div className="menui">
            <i className="fas fa-bars menu-icon"></i>
          </div>
          <img src={Logo} alt="Gmail Logo" style={{ width: "80px" }} />
        </div>
        <div
          style={{
            display: "flex",
            alignItems: "center",
            gap: "10px",
            marginRight: "20px",
          }}
        >
          <img
            src={UserImage}
            style={{ borderRadius: "50%", width: "30px" }}
            alt=""
          />
          <h6>Thanush</h6>
          <h6>[Admin]</h6>
        </div>
      </div>
      {/* <button onClick={handleLogout}>Logout</button> */}
    </div>
  );
}

export default AdminDashboard;
